import { Component } from "react";
export default class BuildForm extends Component {
  render() {
    // Récupérer les données passées via props
    const { data } = this.props?.context;

    return (
      <div>
      {data.map((e) => <div>e.title</div>)}
      </div>
    );
  }
}
